import React from 'react';


export default function UserList({users}) {

    return(
        <div>
            <h3> Users in room </h3>
    <ul>
    {users && users.map((user, index) => {
      return <li key={index}> {user.username} </li>  
    }) }    
    </ul>

        </div>
    )

}
